create table Users (
	UserID VARCHAR(50),
	Username VARCHAR(50),
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	DateOfBirth DATE,
	Password VARCHAR(50),
	DateAdded DATE
);


create table Friends (
	FriendID VARCHAR(50),
	FriendWhoAdded INT,
	FriendBeingAdded INT,
	IsAccepted VARCHAR(50),
	DateOfBirth DATE
);


create table Groups (
	GroupID VARCHAR(50),
	GroupName VARCHAR(10),
	CreatedBy INT,
	DateAdded DATE
);


create table Posts (
	PostID VARCHAR(50),
	PostDescription TEXT,
	PostedBy INT,
	IsPublic VARCHAR(50),
	IsOnlyForFriends VARCHAR(50),
	GroupID INT,
	DatePosted DATE
);

